INSERT INTO `adminnotification_inbox` VALUES ('1',4,'2018-08-06 15:42:38','Join our early access program for Magento Payments. Learn more!','Want to get exclusive access to an upcoming new product before it is released to the public?\n\nWant to help influence new payment features Magento is building?\n\nJoin our Early Adopter Program and play a pivotal role in the validation of one of Magento’s newest products.  You will get access to Magento Payments – the payment solution built for Magento by Magento. Magento Payments enables you to instantly accept payments from your customers, offers the right payment options and allows you to manage financial operations with minimal effort. \n \nWe will be granting access to this program to a select number of merchants - we are looking for active participation and regular feedback.\n\nIf you would like to participate and your business is based in the United States, please send an email to: payments@magento.com','www.magento.com',0,0),('2',1,'2018-09-18 23:21:46','Magento Open Source 2.2.6 delivers important security updates along with performance and functionality enhancements – 9/18/2018','The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.6-and-2.1.15-security-update','https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html',0,0),('3',4,'2018-10-30 18:22:42','Help Magento improve our product - take a brief survey ','We want your perspectives on Personalization and Experience Optimization. \n\nYour feedback is 100% confidential.\n\nExperience Optimization refers to A/B/n Testing, Recommendations, and Experience Targeting (dynamic content, emails, promotions, etc.)\n\nThank you!\n\nClick here\nhttps://www.surveymonkey.com/r/M2-Exp-Opt-Oct2018','https://www.surveymonkey.com/r/M2-Exp-Opt-Oct2018',0,0),('4',4,'2018-11-27 20:30:21','Benefit from the Magento Ad Channels Early Access Program','Magento Ad Channels will simplify the set up and administration of Google Merchant Center and Google Ads, while also helping maximize Google Ads ROI to help you accelerate your business growth.\n \nAs an Early Access Program participant, you will gain:\n \n• Exclusive pre-release access to Magento Ad Channels\n• Feedback opportunities to impact features and capabilities\n \nIf you’re a Magento Open Source 2.2.2 or later user, please send an email to sales_channels@magento.com to participate.','https://magento.com/google-smart-shopping-campaigns-in-magento',0,0),('5',1,'2018-11-28 21:03:20','Magento Open Source 2.3.0 delivers Powerful New Merchant and Developer Experience Enhancements – 11/28/2018','The latest release of Magento Commerce includes powerful new tools that enhance both merchant and developer experiences like multi-source inventory management to improve operations and PWA Studio to help create engaging mobile shopping experiences. Magento 2.3 also delivers important security enhancements and performance improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements.','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),('6',4,'2018-12-18 22:29:42','Take our brief product survey.','We are evaluating adding a media library into the Magento content management system to enable merchants to access their own saved media without re-uploading it each time. This media library may also potentially include third-party stock media with a selection of free and paid media (images, videos, etc.). \n\nTake our survey here:\nhttps://www.surveymonkey.com/r/MWJJWQP\n\nYour survey answers will help us determine the level of interest in these features.','https://www.surveymonkey.com/r/MWJJWQP',0,0),('7',4,'2019-02-12 22:15:58','Take our brief product survey.','Hello Magento Community, \n\nThrough this survey, the product team at Magento wants seek feedback on three different topics i.e. Magento Security,  Sales Channel, and Magento Cloud. Your feedback will help us to make better product decisions in future.\n\n**if you are a partner/non-seller/non-merchant taking this survey, please respond to the survey on behalf of your clients/merchants to whom these questions/topics may apply.\n\nYour feedback is 100% confidential and will not be shared in any way.\n\n\nThanks\nMagento UX\n\nhttps://www.surveymonkey.com/r/M2_Feb2019_ProductUXSurvey\n','https://www.surveymonkey.com/r/M2_Feb2019_ProductUXSurvey',0,0),('8',3,'2018-09-29 08:00:00','September 2018: Mageplaza Extensions Releases','In September 2018, we released 4 brand new extension(s), and update 9 extension(s). Please read the following information to learn what we’ve worked on this month.','https://www.mageplaza.com/blog/releases-2018-09/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=released',0,0),('9',3,'2018-10-29 08:00:00','October 2018: Mageplaza Extensions Releases','In October 2018, we released 3 brand new extension(s), and update 10 extension(s). Please read the following information to learn what we’ve worked on this month.','https://www.mageplaza.com/blog/releases-2018-10/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=released',0,0),('10',4,'2018-10-30 00:00:00','Creepy Halloween Sales up to 100% off','This party is not for the faint-hearted. Are you brave enough to join us? If you stay, the good news is you have a chance to get from at least 10% to 100% discount on Mageplaza store.','https://www.mageplaza.com/halloween-2018/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=halloween',0,0),('11',4,'2018-11-22 00:00:00','Holiday Shopping Season Ultimate Guidelines 2018','The Ultimate Guides for Holiday Shopping Season','https://www.mageplaza.com/blog/holiday-shopping-season/home.html?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=BFCM',0,0),('12',4,'2018-11-23 00:00:00','BFCM is here, 40% OFF','The biggest sales of the year. 40% off on everything Nov 23-26 EST Time.','https://www.mageplaza.com/magento-2-extensions/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=BFCM',0,0),('13',4,'2018-11-30 00:00:00','November Updates &amp; Releases for your Mageplaza Extensions','In November 2018, we released 2 brand new extensions, and update 3 extensions. Please read the following information to learn what we’ve worked on this month.','https://www.mageplaza.com/blog/releases-2018-11/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=released',0,0),('14',4,'2018-12-12 00:00:00','December Updates &amp; Releases for your Mageplaza Extensions','In December 2018, we released 5 brand new extensions, and update 4 extensions. Please read the following information to learn what we’ve worked on this month.','https://www.mageplaza.com/blog/releases-2018-12/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=released',0,0),('15',4,'2018-12-21 00:00:00','Xmas sale 2018 - 30% off on all extensions','A big chance to buy Mageplaza extensions with 30% off which you will definitely use in 2019. Be quick and save money NOW!','https://www.mageplaza.com/magento-2-extensions/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=XMAS',0,0),('16',4,'2019-01-31 00:00:00','January Updates &amp; Releases for your Mageplaza Extensions','In January 2019, we released 20 brand new extensions, and update 17 extensions. Please read the following information to learn what we’ve worked on this month.','https://www.mageplaza.com/blog/releases-2019-01/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=released',0,0),('17',4,'2019-02-01 00:00:00','A Big Change in Mageplaza Refund Policy from Feb 01 2019','From Feb 01, 2019, Mageplaza officially applies a new refund policy which allows customers to ask for a full refund within 60 days instead of 30 days. Please read the details to learn more','https://www.mageplaza.com//blog/double-extend-to-60-day-money-back-guarantee.html/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=refundpolicy',0,0),('18',4,'2019-02-04 00:00:00','Lunar New Year Sale 2019','Don\'t miss a chance to get Mageplaza extensions with 25% off from Feb 04 to Feb 06 (EST timezone). Be quick friends!','https://www.mageplaza.com/magento-2-extensions/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=Tetsale2019',0,0),('19',4,'2019-02-14 00:00:00','Couples\' Day Sale 2019','Use code COUPLE25 when you buy 2 extensions to get 25% off. From Feb 14 to 16 (EST timezone). Our message: Great things come in pairs','https://www.mageplaza.com/deals/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=valentine2019',0,0);
