INSERT INTO `catalog_product_entity_text` VALUES ('1',85,0,'1','shirt'),('6',75,0,'3','<p><span>Our e-liquid contains a proprietary formulation that combines glycerol, propylene glycol, natural oils, extracts and flavor, nicotine and benzoic acid. Together with temperature-regulated vapor technology, this proprietary chemistry enables JUUL to deliver a vapor experience like no other.</span></p>'),('7',85,0,'3','kachi'),('8',85,0,'4','onion'),('9',75,0,'5','<p>The pea is most commonly the small spherical seed or the seed-pod of the pod fruit Pisum sativum. Each pod contains several peas, which can be green or yellow. Pea pods are botanically fruit, since they contain seeds and develop from the ovary of a flower.</p>'),('10',76,0,'5','<p>Green peas are a popular vegetable. They are also quite nutritious and contain a fair amount of fiber and antioxidants.</p>\r\n<p>Additionally, research shows they may help protect against some chronic illnesses, such as heart disease and cancer.</p>\r\n<p>On the other hand, some people claim green peas are harmful and should be avoided due to the antinutrients they contain, which can cause bloating.</p>\r\n<p>This article takes a detailed look at green peas to determine if they\'re healthy or you should limit them in your diet.</p>'),('11',85,0,'5','Green pea'),('12',75,0,'1','<p>Johnnie Walker Red Label continues to be one of .Australia\'s favourite Scotch whiskies. With a pedigree that dates back to 1820 when John Walker himself was bottling and selling whisky in his grocery store, it was his son, Alexander Walker, who began the legacy that has made Johnnie Walker the iconic name it is today. The Red Label was first introduced in 1909 and contains an expert blend of 35 grain and malt whiskies to produce a whisky ideally suited for mixing. In fact, it was known that Johnnie Walker Red was the favourite whisky of Winston Churchill who loved to blend it with soda.</p>'),('13',76,0,'1','<p>Johnnie Walker Red Label continues to be one of .Australia\'s favourite Scotch whiskies. With a pedigree that dates back to 1820 when John Walker himself was bottling and selling whisky in his grocery store, it was his son, Alexander Walker, who began the legacy that has made Johnnie Walker the iconic name it is today. The Red Label was first introduced in 1909 and contains an expert blend of 35 grain and malt whiskies to produce a whisky ideally suited for mixing. In fact, it was known that Johnnie Walker Red was the favourite whisky of Winston Churchill who loved to blend it with soda.</p>'),('14',75,0,'6','<p>“It’s just an oil,” you would think. What’s so special about an oil made from seeds? Well, mustard oil is not just like any other oil you use in your cooking. It is a true superhero.</p>\r\n<p>Don’t believe us? Read this article, and you will surely change your stance.</p>'),('15',76,0,'6','<p>“It’s just an oil,” you would think. What’s so special about an oil made from seeds? Well, mustard oil is not just like any other oil you use in your cooking. It is a true superhero.</p>\r\n<p>Don’t believe us? Read this article, and you will surely change your stance.</p>\r\n<div class=\"admin__field-complex-content\" data-bind=\"html: $data.content\">Configurable products allow customers to choose options (Ex: shirt color). You need to create a simple product for each configuration (Ex: a product for each color).</div>'),('16',85,0,'6','shirt'),('17',75,0,'8','<p>“It’s just an oil,” you would think. What’s so special about an oil made from seeds? Well, mustard oil is not just like any other oil you use in your cooking. It is a true superhero.</p>\r\n<p>Don’t believe us? Read this article, and you will surely change your stance.</p>'),('18',76,0,'8','<p>“It’s just an oil,” you would think. What’s so special about an oil made from seeds? Well, mustard oil is not just like any other oil you use in your cooking. It is a true superhero.</p>\r\n<p>Don’t believe us? Read this article, and you will surely change your stance.</p>\r\n<div class=\"admin__field-complex-content\" data-bind=\"html: $data.content\">Configurable products allow customers to choose options (Ex: shirt color). You need to create a simple product for each configuration (Ex: a product for each color).</div>'),('21',76,0,'3','<p><span>Our e-liquid contains a proprietary formulation that combines glycerol, propylene glycol, natural oils, extracts and flavor, nicotine and benzoic acid. Together with temperature-regulated vapor technology, this proprietary chemistry enables JUUL to deliver a vapor experience like no other.</span></p>'),('22',75,0,'10','With its unique satisfaction profile, simple interface, flavor variety and lack of lingering smell, JUUL stands out as the vapor alternative.'),('23',76,0,'10','With its unique satisfaction profile, simple interface, flavor variety and lack of lingering smell, JUUL stands out as the vapor alternative.');
