INSERT INTO `catalogsearch_fulltext_scope1` VALUES ('1','73','RedLevel'),('1','74','rl-01'),('1','75','Johnnie Walker Red Label continues to be one of .Australia\'s favourite Scotch whiskies. With a pedigree that dates back to 1820 when John Walker himself was bottling and selling whisky in his grocery store, it was his son, Alexander Walker, who began the legacy that has made Johnnie Walker the iconic name it is today. The Red Label was first introduced in 1909 and contains an expert blend of 35 grain and malt whiskies to produce a whisky ideally suited for mixing. In fact, it was known that Johnnie Walker Red was the favourite whisky of Winston Churchill who loved to blend it with soda.'),('1','76','Johnnie Walker Red Label continues to be one of .Australia\'s favourite Scotch whiskies. With a pedigree that dates back to 1820 when John Walker himself was bottling and selling whisky in his grocery store, it was his son, Alexander Walker, who began the legacy that has made Johnnie Walker the iconic name it is today. The Red Label was first introduced in 1909 and contains an expert blend of 35 grain and malt whiskies to produce a whisky ideally suited for mixing. In fact, it was known that Johnnie Walker Red was the favourite whisky of Winston Churchill who loved to blend it with soda.'),('3','73','kachi'),('3','74','kachi'),('3','75','Our e-liquid contains a proprietary formulation that combines glycerol, propylene glycol, natural oils, extracts and flavor, nicotine and benzoic acid. Together with temperature-regulated vapor technology, this proprietary chemistry enables JUUL to deliver a vapor experience like no other.'),('3','76','Our e-liquid contains a proprietary formulation that combines glycerol, propylene glycol, natural oils, extracts and flavor, nicotine and benzoic acid. Together with temperature-regulated vapor technology, this proprietary chemistry enables JUUL to deliver a vapor experience like no other.'),('4','73','oreostant'),('4','74','onion'),('5','73','green rusk jull'),('5','74','Green pea'),('5','75','The pea is most commonly the small spherical seed or the seed-pod of the pod fruit Pisum sativum. Each pod contains several peas, which can be green or yellow. Pea pods are botanically fruit, since they contain seeds and develop from the ovary of a flower.'),('5','76','Green peas are a popular vegetable. They are also quite nutritious and contain a fair amount of fiber and antioxidants. Additionally, research shows they may help protect against some chronic illnesses, such as heart disease and cancer. On the other hand, some people claim green peas are harmful and should be avoided due to the antinutrients they contain, which can cause bloating. This article takes a detailed look at green peas to determine if they\'re healthy or you should limit them in your diet.'),('6','73','Jullooo'),('6','74','moil-02'),('6','75','“It’s just an oil,” you would think. What’s so special about an oil made from seeds? Well, mustard oil is not just like any other oil you use in your cooking. It is a true superhero. Don’t believe us? Read this article, and you will surely change your stance.'),('6','76','“It’s just an oil,” you would think. What’s so special about an oil made from seeds? Well, mustard oil is not just like any other oil you use in your cooking. It is a true superhero. Don’t believe us? Read this article, and you will surely change your stance. Configurable products allow customers to choose options (Ex: shirt color). You need to create a simple product for each configuration (Ex: a product for each color).'),('8','73','denim beer rusk'),('8','74','jullo01'),('8','75','“It’s just an oil,” you would think. What’s so special about an oil made from seeds? Well, mustard oil is not just like any other oil you use in your cooking. It is a true superhero. Don’t believe us? Read this article, and you will surely change your stance.'),('8','76','“It’s just an oil,” you would think. What’s so special about an oil made from seeds? Well, mustard oil is not just like any other oil you use in your cooking. It is a true superhero. Don’t believe us? Read this article, and you will surely change your stance. Configurable products allow customers to choose options (Ex: shirt color). You need to create a simple product for each configuration (Ex: a product for each color).'),('10','73','Wine'),('10','74','device'),('10','75','With its unique satisfaction profile, simple interface, flavor variety and lack of lingering smell, JUUL stands out as the vapor alternative.'),('10','76','With its unique satisfaction profile, simple interface, flavor variety and lack of lingering smell, JUUL stands out as the vapor alternative.');
