1080, 3],\r\n                        itemsDesktopSmall: [860, 3],\r\n                        itemsTablet: [768, 2],\r\n                        itemsTabletSmall: [639, 2],\r\n                        itemsMobile: [479, 1],\r\n                        pagination: false,\r\n                        autoPlay: 3000,\r\n                        navigationText: [\'<div class=\"lft-btn\"><i class=\"fa fa-angle-left\"></i></div>\', \'<div class=\"rgt-btn\"><i class=\"fa fa-angle-right\"></div>\'],\r\n                        navigation: true,\r\n                    });\r\n                });\r\n            });\r\n// ]]></script>\r\n</div>\r\n</div>','2018-10-25 18:13:44','2019-02-13 11:51:09',1),(5,'Home Testimonials','home_testimonials','<div class=\"htb-main pad-main\">\r\n<div class=\"block-title-main\">\r\n<h2>What Our Customer Says</h2>\r\n<div class=\"title-border\"></div>\r\n</div>\r\n<div class=\"htb-main\">\r\n<div class=\"htb-content htb-slider\">\r\n<div class=\"htb-inner\">\r\n<div class=\"htb-img\"><a href=\"#\"> <img class=\"img-resp center-b\" src=\"{{media url=\"wysiwyg/home/client1.jpg\"}}\" alt=\"img-85-85\" /> </a></div>\r\n<div class=\"htb-content-inner\">\r\n<p><em>Top off your drink, and read on to learn where these beverages are produced, how they’re made and the terminology that describes it all. Becoming an expert in the ever-changing world of spirits is a lifelong endeavor, one that will only enhance your appreciation of these remarkable inventions. </em></p>\r\n<div class=\"htb-sept\"></div>\r\n<div class=\"htb-info\">\r\n<div class=\"htb-name\">John Doe</div>\r\n<p>CEO</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"htb-inner\">\r\n<div class=\"htb-img\"><a href=\"#\"> <img class=\"img-resp center-b\" src=\"{{media url=\"wysiwyg/home/client2.jpg\"}}\" alt=\"img-85-85\" /> </a></div>\r\n<div class=\"htb-content-inner\">\r\n<p><em>With more than 3,000 spirits available on this site and in the typical Total Wine &amp; More store, our online Guide to Spirits (and a pocket-sized hard copy, available free in any of our stores) is an indispensible guide. You’ll find our favorite products in every category of spirits, including whiskeys, vodka, rum, tequila, brandy and cordials, at every price level. </em></p>\r\n<div class=\"htb-sept\"></div>\r\n<div class=\"htb-info\">\r\n<div class=\"htb-name\">John Doe</div>\r\n<p>Developer</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"htb-inner\">\r\n<div class=\"htb-img\"><a href=\"#\"> <img class=\"img-resp center-b\" src=\"{{media url=\"wysiwyg/home/client3.jpg\"}}\" alt=\"img-85-85\" /> </a></div>\r\n<div class=\"htb-content-inner\">\r\n<p><em>More than that, the Guide to Spirits tells you the story of your favorite spirits – and the ones you have yet to discover. Distilling spirits is chemistry, of course, but it’s also a tale of individual artisans, using time-tested recipes as the bases for their creations. The results can be as different as a traditional single-malt scotch … and a vodka infused with the most up-to-the-minute flavor. </em></p>\r\n<div class=\"htb-sept\"></div>\r\n<div class=\"htb-info\">\r\n<div class=\"htb-name\">John Doe</div>\r\n<p>Designer</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<script type=\"text/javascript\" xml=\"space\">// <![CDATA[\r\n            require([\'jquery\', \'cpowlcarousel\'], function ($) {\r\n                $(document).ready(function () {\r\n                    $(\".htb-slider\").owlCarousel({\r\n                        items: 1,\r\n                        itemsDesktop: [1080, 1],\r\n                        itemsDesktopSmall: [860, 1],\r\n                        itemsTablet: [768, 1],\r\n                        itemsTabletSmall: [639, 1],\r\n                        itemsMobile: [479, 1],\r\n                        pagination: false,\r\n                        navigationText: [\'<div class=\"lft-btn\"><i class=\"fa fa-angle-left\"></i></div>\', \'<div class=\"rgt-btn\"><i class=\"fa fa-angle-right\"></div>\'],\r\n           